<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title>Title</title>
</head>
<body>
<script>
    let a = [7, 2, 5, 3, 5, 3];
    let b = [7, 2, 5, 4, 6, 3, 5, 3];
    let check = false;
    let save = [];
    for (let i =0; i<b.length;i++){
        check = false;
        for (let j=0; j<a.length;j++){
            if(b[i] === a[j]){
                check = true;
            }
        }
        if(!check){
            save.push(b[i])
        }
    }
    console.log(save)
</script>
</body>
</html>
